async def request_body_to_args(
    required_params: List[ModelField],
    received_body: Optional[Union[Dict[str, Any], FormData]],
) -> Tuple[Dict[str, Any], List[ErrorWrapper]]:
    values = {}
    errors = []

    if received_body is not None:
        received_data = dict(received_body)
    else:
        received_data = {}

    for field in required_params:
        field_value = received_data.get(field.alias)
        if field_value is not None and (isinstance(field_value, list) or isinstance(field_value, set) or isinstance(field_value, tuple)):
            if field.shape == "list":
                values[field.name] = list(field_value)
            elif field.shape == "set":
                values[field.name] = set(field_value)
            elif field.shape == "tuple":
                values[field.name] = tuple(field_value)
        else:
            values[field.name], field_errors = field.validate(value, values, loc=("body", field.alias))
            if isinstance(field_errors, ErrorWrapper):
                errors.append(field_errors)
            elif isinstance(field_errors, list):
                errors.extend(field_errors)

    return values, errors
